import React, {Component} from 'react';
import './App.css';
import ParticlesBg from 'particles-bg';
import Navigation from './Components/Navigation/Navigation';
import URLinput from './Components/URLinput/URLinput';
import Rank from './Components/Rank/Rank';
import Clarifai from 'clarifai';

const PAT = 'af3372ee16b04b788518c454dd35f8f9';
const USER_ID = 'calvinyoon';
const APP_ID = 'my-first-application';
const MODEL_ID = 'a403429f2ddf4b49b307e318f00e528b';
const MODEL_VERSION_ID = Clarifai.FACE_DETECT_MODEL;
const IMAGE_URL = 'https://samples.clarifai.com/face-det.jpg'

    const raw = JSON.stringify({
        "user_app_id": {
            "user_id": USER_ID,
            "app_id": APP_ID
        },
        "inputs": [
            {
                "data": {
                    "image": {
                        "url": IMAGE_URL
                    }
                }
            }
        ]
    });

    const requestOptions = {
        method: 'POST',
        headers: {
            'Accept': 'application/json',
            'Authorization': 'Key ' + PAT
        },
        body: raw
    };

class App extends Component {
  constructor() {
    super()
    this.state = {
      input: '',
    }
  }

  onInputChange = (event) => {
    console.log(event.target.value);
  }

  onButtonSubmit = () => {
    //console.log(Clarifai)
    fetch("https://api.clarifai.com/v2/models/" + MODEL_ID + "/versions/" + MODEL_VERSION_ID + "/outputs", requestOptions)
    .then(
      function(response) {
        console.log('yes', response);
      }
    );

    //model 6dc7e46bc9124c5c8824be4822abe105 api af3372ee16b04b788518c454dd35f8f9
  }

  render() {
    return (
      <div className="App">
        <ParticlesBg type="cobweb" color="#ffffff" bg={{position: "fixed", left: 0, top: 0}} className="particles-bg"/>
        <Navigation />
        <Rank />
        <URLinput onInputChange={this.onInputChange} onButtonSubmit={this.onButtonSubmit}/>
      </div>
    );
  }
}

export default App;
